import { StyleSheet, View, TextInput, Button } from 'react-native'

const Login = () => {
  return (
    <View>
      <TextInput 
        style={styles.input}
        placeholder='Username'
      />
      <TextInput 
        style={styles.input}
        placeholder='Password'
      />
      <Button
        title='Login'
      />
    </View>
  )
}

const styles = StyleSheet.create({
  input: {
    padding: '5px',
    border: '1px solid #CCCCCC',
    borderRadius: '8px',
  }
})

export default Login
